// src/ExamSelection.js
import React from 'react';
import { Link } from 'react-router-dom';

const ExamSelection = () => {
  // Mock data for available tests
  const tests = [
    { id: 1, name: 'Math Test' },
    { id: 2, name: 'Science Test' },
  ];

  return (
    <div className="container mt-5">
      <h1>Select an Exam</h1>
      <ul className="list-group mt-3">
        {tests.map((test) => (
          <li key={test.id} className="list-group-item d-flex justify-content-between align-items-center">
            {test.name}
            <Link to={`/takeexam/${test.id}`} className="btn btn-primary">Take Exam</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ExamSelection;
